import React from 'react';

const ProductDisplay = ({ product }) => {
  if (!product) return <div>Loading...</div>;

  return (
    <div>
      <h2>{product.product_name}</h2>
      <h5>{product.category}</h5>
    </div>
  );
};

export default ProductDisplay;
